    <Label for="examplePassword" hidden >Password</Label>
    <Input id="examplePassword"name="password"placeholder="Password"type="password"/>
  </FormGroup>
  {' '}
  <Button>
    Submit
  </Button>
</Form>

  </div>
  );
}

